import './ExpenseList.css'
import ExpenseItem from './ExpenseItem';
function ExpenseList(peops){
    return (
        <ul>
            {PaymentResponse.items.map((eachValue) => (
      <ExpenseItem
        key={eachValue.id}
        name={eachValue.title}
        date={eachValue.date}
        amount={eachValue.amount}
      />
    ))}
        </ul>
    );
}
export default ExpenseList;
